import React from 'react';

const VideoItem = ({ video, onUpVote, onDownVote, onDelete }) => {
  return (
    <div className="video-item">
      <h3>{video.title}</h3>
      {/* <iframe
        src={video.url}
        title={video.title}
        width="560"
        height="315"
        frameBorder="0"
        allowFullScreen
      ></iframe> */}
      <iframe width="1440" height="762" src="https://www.youtube-nocookie.com/embed/7cjVj1ZyzyE"

frameborder="0" allow="autoplay; encrypted-media" allowfullscreen></iframe>
      <p>Votes: {video.votes}</p>
      <button onClick={() => onUpVote(video)}>Up Vote</button>
      <button onClick={() => onDownVote(video)}>Down Vote</button>
      <button onClick={() => onDelete(video)}>Delete</button>
    </div>
  );
};

export default VideoItem;
